import React, { useEffect, useState } from 'react';
import { Container, Grid, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { Home, Inbox, Mail, LiveTv, ViewComfy, Timeline, MoreHoriz } from '@mui/icons-material';
import './App.css'; 
import logo from './assets/secura.png';

const App = () => {
  const [userData, setUserData] = useState({ name: '', avatar: '' });

  useEffect(() => {
    // Simulate fetching user data from an API
    fetchUserData().then(data => {
      setUserData(data);
    });
  }, []);

  const fetchUserData = async () => {
    // Replace this with your actual API call to fetch user data
    // Example response structure: { name: 'John Doe', avatar: 'user-avatar-url' }
    const response = await fetch('your-api-endpoint');
    const data = await response.json();
    return data;
  };
  const pageStyles = {
    backgroundColor: '#111115',
    minHeight: '100vh',
    display: 'flex',
  };

  const sidebarStyles = {
    backgroundColor: '#151515',
    width: '8vw',
    padding: '16px',
    minHeight: '100vh',
    marginLeft: '-130px',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  };

  const listItemStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '12px',
  };

  const logoStyles = {
    width: '3vw', // Adjust the width as needed
    height: '6vh', // Adjust the height as needed
    marginBottom: '20px',
  };

  const secondSidebarStyles = {
    backgroundColor: '#0D0D0F',
    width: '15vw',
    padding: '16px',
    minHeight: '100vh',
    color: 'white',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  };

  // Responsive styles for the sidebar
  const responsiveStyles = {
    '@media (max-width: 768px)': {
      sidebarStyles: {
        width: '25vw', // Adjust the width for smaller screens
      },
      secondSidebarStyles: {
        width: '20vw', // Adjust the width for smaller screens
      },
    },
  };

  return (
    <div style={pageStyles}>
      <Container>
        <Grid container>
          <Grid sx={{ ...sidebarStyles, ...responsiveStyles.sidebarStyles }}>
            <img src={logo} alt="Logo" style={logoStyles} />
            <div>
              <img src={userData.avatar} alt="User Avatar" style={avatarStyles} />
              <div style={{ color: 'white' }}>{userData.name}</div>
            </div>
            <List>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '25px' }}>
                  <Home />
                </ListItemIcon>
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '25px' }}>
                  <Inbox />
                </ListItemIcon>
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '25px' }}>
                  <Mail />
                </ListItemIcon>
              </ListItem>
            </List>
          </Grid>
          <Grid sx={{ ...secondSidebarStyles, ...responsiveStyles.secondSidebarStyles }}>
            <List>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <LiveTv />
                </ListItemIcon>
                <ListItemText primary="Live" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <ViewComfy />
                </ListItemIcon>
                <ListItemText primary="Layout" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <Timeline />
                </ListItemIcon>
                <ListItemText primary="Sequence" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white', marginLeft: '10px' }}>
                  <MoreHoriz />
                </ListItemIcon>
                <ListItemText primary="More" />
              </ListItem>
            </List>
          </Grid>
          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
